  false,\n\t\"url\": null,\n\t\"notes\": \"There are nine major classes of liquor
  licenses in the City of Chicago, the most common being Tavern, Package Goods and
  Incidental - Consumption on Premises.  These categories were established to help
  the City identify and regulate the various types of establishments serving alcoholic
  beverages.  They are described at the following link: http://bit.ly/P0Gn4c. rn rnThe
  Chicago City Council has passed a series of ordinances restricting the issuance
  of liquor licenses in various locations throughout the City in sections 4-60-022
  and 4-60-023 of the Municipal Code.  In general, consumption on premises liquor
  licenses are affected by the 022 moratorium and Package Goods are affected by the
  023 moratorium.   However, moratoriums can be complicated, so determining whether
  or not a moratorium applies to a specific license application is not always straightforward.
  \  Users of the data should contact the Department of Business Affairs and Consumer
  Protection if they have any questions.rn rnThese GIS layers show the locations of
  moratoriums passed by the City Council.  It is updated monthly if any restrictions
  have been added or deleted.  Columns are as follows:rnu2022tCODE refers to the specific
  ordinance passed by City County.  If there are more than one, they are connected
  by an underscore.  They are in the format ww.nnn where ww is the ward number and
  nnn is a sequential number. rnu2022tST_SDE refers to which side of the street the
  ordinance refers to.  rnu2022tCREADATE is the date that the ordinance was input
  into the digital system, usually within a week after passed by City Council.   Dates
  before 2003 do not relect the actual date passed.rnrnTo view or use this KML file,
  special GIS software such as Google Earth is required. To download, right-click
  the \"Download\" link above and choose \"Save link as.\"\",\n\t\"owner_org\": \"86c0c3d9-3826-47ab-a773-6924b858dd04\",\n\t\"extras\":
